import React from 'react';
import ReactAnimatedWeather from 'react-animated-weather';

const WeatherIconTwo = props => {
  if (!props.icon) {
    return `Loading...`;
  }

  console.log(typeOfIcon(props.icon));
  console.log(props.icon);

  console.log(colors[props.icon]);

  return <div>WeatherIconTwo</div>;
};

export default WeatherIconTwo;
